// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.6.0 <0.9.0;

contract Storage {
    struct File {
        uint256 fileId;
        string fileHash;
        uint256 fileSize;
        string fileType;
        string fileName;
        string fileDescription;
        uint256 uploadTime;
        address uploader;
    }

    File[] public files;

    uint256 public totalFileCount = 0;

    uint256 public fileIndex = 0;

    event FileUploaded(
        uint256 fileId,
        string fileHash,
        uint256 fileSize,
        string fileType,
        string fileName,
        string fileDescription,
        uint256 uploadTime,
        address indexed uploader
    );

    event FileDeleted(
        uint256 fileId,
        uint256 deleteTime,
        address indexed deleter
    );

    event FileUpdated(
        uint256 fileId,
        string fileName,
        string fileDescription,
        uint256 updatedTime,
        address indexed updater
    );

    function uploadFile(
        string memory _fileHash,
        uint256 _fileSize,
        string memory _fileType,
        string memory _fileName,
        string memory _fileDescription
    ) public {
        require(bytes(_fileHash).length > 0);
        require(bytes(_fileType).length > 0);
        require(bytes(_fileDescription).length > 0);
        require(bytes(_fileName).length > 0);
        require(msg.sender != address(0));
        require(_fileSize > 0);

        fileIndex++;

        File memory newFile = File(
            fileIndex,
            _fileHash,
            _fileSize,
            _fileType,
            _fileName,
            _fileDescription,
            block.timestamp,
            msg.sender
        );

        files.push(newFile);

        totalFileCount++;

        emit FileUploaded(
            fileIndex,
            _fileHash,
            _fileSize,
            _fileType,
            _fileName,
            _fileDescription,
            block.timestamp,
            msg.sender
        );
    }

    function updateFile(uint256 _fileId, string memory _fileDescription)
        public
        returns (bool success)
    {
        require(bytes(_fileDescription).length > 0);
        require(msg.sender != address(0));
        if (!fileExist(_fileId)) revert("This file does not exist");

        for (uint256 i = 0; i < totalFileCount; i++) {
            if (files[i].fileId == _fileId) {
                if (files[i].uploader != msg.sender)
                    revert("You can not update files that is not yours");
                files[i].fileDescription = _fileDescription;

                emit FileUpdated(
                    _fileId,
                    files[i].fileName,
                    _fileDescription,
                    block.timestamp,
                    msg.sender
                );

                return true;
            }
        }

        return false;
    }

    function deleteFile(uint256 _fileId) public returns (bool success) {
        require(msg.sender != address(0));
        if (!fileExist(_fileId)) revert("This file does not exist");

        for (uint256 i = 0; i < totalFileCount; i++) {
            if (files[i].fileId == _fileId) {
                if (files[i].uploader != msg.sender)
                    revert("You can not delete files that is not yours");
                files[i] = files[totalFileCount - 1];
                delete files[totalFileCount - 1];
                totalFileCount--;
                files.pop();
                emit FileDeleted(_fileId, block.timestamp, msg.sender);
                return true;
            }
        }

        return false;
    }

    function getFileCount() private view returns (uint256 count) {
        return files.length;
    }

    function fileExist(uint256 _fileId) public view returns (bool success) {
        if (totalFileCount == 0) return false;

        for (uint256 i = 0; i < totalFileCount; i++) {
            if (files[i].fileId == _fileId) {
                return true;
            }
        }

        return false;
    }
}
